import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import Login from './components/Login';
import Register from './components/Register';
import PatientDashboard from './components/PatientDashboard';
import DoctorDashboard from './components/DoctorDashboard';
import StaffDashboard from './components/StaffDashboard';

function App() {
  const [user, setUser] = useState(null);

  const handleLogin = (userData) => setUser(userData);
  const handleLogout = () => setUser(null);

  return (
    <Router>
      <Header user={user} onLogout={handleLogout} />
      <main className="flex-grow container mx-auto p-4">
        <Routes>
          <Route path="/login" element={<Login onLogin={handleLogin} />} />
          <Route path="/register" element={<Register />} />
          <Route path="/patient-dashboard" element={user && user.role === 'patient' ? <PatientDashboard user={user} /> : <Login onLogin={handleLogin} />} />
          <Route path="/doctor-dashboard" element={user && user.role === 'doctor' ? <DoctorDashboard user={user} /> : <Login onLogin={handleLogin} />} />
          <Route path="/staff-dashboard" element={user && user.role === 'staff' ? <StaffDashboard user={user} /> : <Login onLogin={handleLogin} />} />
        </Routes>
      </main>
      <Footer />
    </Router>
  );
}

export default App;
